## Areas Tested

### Input Element Attributes
- `list` - datalist integration
- `minlength` - minimum length validation
- `dirname` - text direction submission
- `form` - associated form ID
- `formaction`, `formenctype`, `formmethod` - form submission overrides
- `formnovalidate`, `formtarget` - form behavior overrides
- `capture` - media capture for file inputs
- `accept` - file type filtering

### Image Element Attributes
- `usemap` - image map association
- `referrerpolicy` - referrer policy control
- `elementtiming` - performance timing API

### Form Element Attributes
- `acceptCharset` - character encoding
- `autocomplete` - form autocomplete behavior
- `name` - form identification
- `novalidate` - validation disabling
- `rel` - relationship annotation
- `target` - submission target

### Script Element Attributes
- `nonce` - CSP nonce
- `referrerpolicy` - referrer policy

### Link Element Attributes
- `as` - resource type hint for preloading
- `referrerpolicy` - referrer policy
- `hreflang` - language hint
- `imagesizes`, `imagesrcset` - responsive image preloading

### Anchor Element Attributes
- `ping` - tracking URLs
- `referrerpolicy` - referrer policy

